import React from 'react'

const ViewItem = ({toDoLists,setToDoLists}) => {
    return (
        <div className="view-item">
            {
                toDoLists.map(item=>{
                    <form key={item.id}>
                        <input type="radiobox"/>
                        <p>{item.text}</p>
                        <div className="btn-hover">
                            <button>X</button>
                        </div>
                    </form>
                })
            }
        </div>
    )
}

export default ViewItem
